using System;
using System.Diagnostics;
using System.Runtime.InteropServices;
using System.Collections.Generic;
using System.Text;
using System.IO;
using HWND = System.IntPtr;


public static class Snippet
{
	public static System.String func()
	{
				string myOutput = "";
                string myText = "";
				string myFile = "";
                HWND shellWindow = GetShellWindow();
                Dictionary<HWND, string> windows = new Dictionary<HWND, string>();

                EnumWindows(delegate (HWND hWnd, int lParam)
                {
                    if (hWnd == shellWindow) return true;
                    if (!IsWindowVisible(hWnd)) return true;

                    int length = GetWindowTextLength(hWnd);
                    if (length == 0) return true;

                    StringBuilder builder = new StringBuilder(length);
                    GetWindowText(hWnd, builder, length + 1);

					uint pid = 0;                
                    GetWindowThreadProcessId(hWnd, out pid);

					var processHandle = OpenProcess(0x1000, false, (int)pid);
					if (processHandle != IntPtr.Zero)
					{
						const int lengthSb = 4000;
						var sb = new StringBuilder(lengthSb);
						if (GetModuleFileNameEx(processHandle, IntPtr.Zero, sb, lengthSb) > 0)
						{
							myFile = Path.GetFileName(sb.ToString());
						}
					}
					CloseHandle(processHandle);


                    myText = builder.ToString() + "~"+myFile+ '~'+pid.ToString();
                    windows[hWnd] = myText;
                    return true;

                }, 0);
		foreach (KeyValuePair<IntPtr, string> window in windows)
            {
                IntPtr handle = window.Key;
                string title = window.Value;

                myOutput = myOutput.Trim() + String.Format("{1}~{0}", title, handle)+"^n";

            }

		return myOutput;
	}
	            private delegate bool EnumWindowsProc(HWND hWnd, int lParam);

            [DllImport("USER32.DLL")]
            private static extern bool EnumWindows(EnumWindowsProc enumFunc, int lParam);

            [DllImport("USER32.DLL")]
            private static extern int GetWindowText(HWND hWnd, StringBuilder lpString, int nMaxCount);

            [DllImport("USER32.DLL")]
            private static extern int GetWindowTextLength(HWND hWnd);

            [DllImport("USER32.DLL")]
            private static extern bool IsWindowVisible(HWND hWnd);

            [DllImport("USER32.DLL")]
            private static extern IntPtr GetShellWindow();
            //WARN: Only for "Any CPU":
            [DllImport("user32.dll", CharSet = CharSet.Auto, SetLastError = true)]
            private static extern int GetWindowThreadProcessId(IntPtr handle, out uint processId);

			[DllImport("kernel32.dll")]
			public static extern IntPtr OpenProcess(uint processAccess, bool bInheritHandle, int processId);

			[DllImport("psapi.dll")]
			static extern uint GetModuleFileNameEx(IntPtr hProcess, IntPtr hModule, [Out] StringBuilder lpBaseName, [In] [MarshalAs(UnmanagedType.U4)] int nSize);

			[DllImport("kernel32.dll", SetLastError = true)]
			[return: MarshalAs(UnmanagedType.Bool)]
			static extern bool CloseHandle(IntPtr hObject);

}

using System;
using System.Diagnostics;
using System.Runtime.InteropServices;

public static class Snippet
{
	public static void func(System.Double myHandle)
	{
		IntPtr handle=(IntPtr)myHandle;

            if (handle == IntPtr.Zero)
            {
                return;
            }
            if (IsIconic(handle))
            {
                ShowWindow(handle, SW_RESTORE);
            }

            SetForegroundWindow(handle);		

	}
        [DllImport("USER32.DLL")]
        public static extern bool SetForegroundWindow(IntPtr hWnd);
        [System.Runtime.InteropServices.DllImport("User32.dll")]
        private static extern bool ShowWindow(IntPtr handle, int nCmdShow);

        [System.Runtime.InteropServices.DllImport("User32.dll")]
        private static extern bool IsIconic(IntPtr handle);

        const int SW_RESTORE = 9;
}

using System;
using System.Runtime.InteropServices;

public static class Snippet
{
	public static void func(System.Double myHandle)
	{
  		IntPtr Hwnd=(IntPtr)myHandle;

		SendMessage(Hwnd,WM_CLOSE,IntPtr.Zero, IntPtr.Zero);		

	}
        [DllImport("user32.dll", CharSet = CharSet.Auto)]
        private static extern IntPtr SendMessage(IntPtr hWnd, UInt32 Msg, IntPtr wParam, IntPtr lParam);

        private const UInt32 WM_CLOSE = 0x0010;
}

